import React, {Component} from 'react'
import StyledForm from "./StyledForm";
import "../../styles/tailwind.min.css"
import tw from 'twin.macro'
import {SectionHeading as HeadingBase} from "../misc/Headings";

const heading = tw.div`mb-40 text-2xl mb-10 text-pink-700`;
const Heading2 = tw(heading)``;

class QuizPage2 extends Component{
    constructor(props) {
        super(props);
        this.state={}
    }

    render() {
        return (
            <StyledForm>

                <form>
                    <Heading2>What size do you typically wear?</Heading2>
                    <div className=" grid grid-cols-2 gap-2">
                        <label>Gender</label>
                        <div className="grid grid-cols-2">
                            <input type="text"/>
                            <div></div>
                        </div>
                        <label>How tall are you?</label>
                        <div className="grid grid-cols-4">
                            <input type="text"/>
                            <label>FT.</label>
                            <input type="text"/>
                            <label>IN.</label>
                        </div>
                        <label>What's your weight?</label>
                        <div className="grid grid-cols-4">
                            <input type="text"/>
                            <label>LBS.</label>
                        </div>
                    </div>
                    <button>Next</button>
                </form>
            </StyledForm>
        )
    }
}

export default QuizPage2
